import React from 'react';

const dummy = {
  isLogin: false,
}

const Home = ({ isLogin }) => {
  return (
    <>
      <div>
        {dummy.isLogin && <div>Home isLogin</div>}
      </div>
    </>
  )
}

export default Home;
